script: |
  super -f text -I q9670.spq | sort > q9670.out

inputs:
  - name: q9670.spq
    data: |
      SELECT ALL col0 AS col2 FROM tab0 (FORMAT parquet) WHERE NOT ( col1 * - - col2 / col0 + - col0 ) BETWEEN ( NULL ) AND - 88 * + col2;
  - name: tab0

outputs:
  - name: q9670.out
    data: |
      15
      87
      97
